import React from 'react'
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';

function Navigbar() {
  return (
    // <Navbar expand="lg" className="bg-body-tertiary">
    //   <Container>
    //     <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
    //     <Navbar.Toggle aria-controls="basic-navbar-nav" />
    //     <Navbar.Collapse id="basic-navbar-nav">
    //       <Nav className="me-auto">
    //         <Nav.Link href="#home">Home</Nav.Link>
    //         <Nav.Link href="#link">Link</Nav.Link>
    //         <NavDropdown title="Dropdown" id="basic-nav-dropdown">
    //           <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
    //           <NavDropdown.Item href="#action/3.2">
    //             Another action
    //           </NavDropdown.Item>
    //           <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
    //           <NavDropdown.Divider />
    //           <NavDropdown.Item href="#action/3.4">
    //             Separated link
    //           </NavDropdown.Item>
    //         </NavDropdown>
    //       </Nav>
    //     </Navbar.Collapse>
    //   </Container>
    // </Navbar>
    <div class="header header-bg">
<a class="img-replace hamburger-header" href="#0"><span>&nbsp;</span></a>
  <div class="container header-container">
    <div class="row">
      <div class="col-sm-8 pull-right">
        <div class="header-top">
          <div class="language-block"> <a href="https://www.keralatourism.org/languages" id="lan"><span class="select-lang">LANGUAGES&nbsp;&nbsp;<i class="fa fa-angle-right"> </i></span><span class="current-lang">ENG</span></a> </div>
                        <div class="site-visit">
            <div class="visit"><span class="txt">Visits since 1 Apr 2023 <i class="fa fa-caret-right" aria-hidden="true"></i></span><span class="count">
              2,913,345              </span></div>
            <div class="visit visit-total"><span class="txt">Visits since 1 Jan 2007 <i class="fa fa-caret-right" aria-hidden="true"></i></span><span class="count">44,774,934</span></div>
          </div>
            <ul class="social-menu">
            <li class="top-share"><a href="http://www.youtube.com/keralatourism" class="yt" target="_blank"><i class="fa fa-youtube"></i></a></li>
            <li class="top-share"><a href="https://www.facebook.com/keralatourismofficial" class="fb" target="_blank"><i class="fa fa-facebook"></i></a></li>
            <li class="top-share"><a href="http://twitter.com/keralatourism" class="tw" target="_blank"><i class="fa fa-twitter"></i></a></li>
            <li class="top-share"><a href="https://www.instagram.com/keralatourism/?hl=en" class="ig" target="_blank"><i class="fa fa-instagram"></i></a></li>
            <li class="top-share"><a href="https://api.whatsapp.com/send?phone=7510512345" class="wa" target="_blank"><i class="fa fa-whatsapp"></i></a></li>
            <li class="top-share"><a href="https://in.pinterest.com/keralatourism/" class="pn" target="_blank"><i class="fa fa-pinterest-p"></i></a></li>
            <li class="top-share"><a href="https://www.linkedin.com/company/keralatourism" class="lk" target="_blank"><i class="fa fa-linkedin"></i></a></li>
          </ul>
        </div>
      </div>
      <div class="col-sm-3">
        <div class="logo"><a href="https://www.keralatourism.org/" title="Kerala Tourism"><img src="https://www.keralatourism.org/images/kt/kerala-tourism-title.png?d=18122017" alt="Kerala Tourism" /></a></div>
      </div>
      <div class="col-sm-9 menu-wrapper">
      <div class="menu">
